    /* harmony default export */


    __webpack_exports__["default"] = "<br/>\n<br/>\n<br/>\n<br/>\n<br/>\n<br/>\n\n<p class=\"animated fadeInLeft\">\n    Us the People was founded on 25 January 2020 in Braamfontein. The Organisation was formed following the Founding Summit, which brought together fearless activists, students, workers and experts from various fields under the need to pursue the equal freedom of all in a stateless society.\n        \n</p>\n<br/>\n<p  class=\"animated fadeInRight\">\n    Us the People have organised ourselves into a revolutionary movement which seeks to pursue the aims of Us the People as outlined in the Founding Manifesto of Us the People.  Us the People have realised that the freedoms achieved by the oppressed in all preceding struggles have been replacements of one domination by another, and most people have given up on resistance. While the conditions of the people make revolution desirable, it is evident from political participation among the people that there is a need for an alternative and futuristic thinking, in our quest to achieve freedom from all forms of domination.\n</p>\n<br/>\n<p  class=\"animated fadeInLeft\">\n    Advancements in science and technology have provided Us with a better understanding of human relations with nature, as well as the realisation of the necessity to oppose the State and all forms of monopolies, not for our sake, but for the sake of the future of humanity. Humans minds are locked in a complex matrix, and our decision is to unplug all minds from the need to dominate and addiction to be dominated.\n</p>\n<br/>\n<p  class=\"animated fadeInRight\">\n  Us the People is a revolutionary organisation with a futuristic outlook and shall propel its principles and ideas in all spheres of society.\n</p>\n<br/>\n<p  class=\"animated fadeInLeft\">\n    Us the Students is the student organisation of Us the People, and is responsible for organising students in institutions of learning.\n</p>\n<br/>\n<p  class=\"animated fadeInRight\">\n    Us the Workers is the labour organisation of Us the People, and is responsible for organising the working class in all workplaces.\n</p>\n<br/>\n<p  class=\"animated fadeInUpBig\">\n    The Founding Manifesto of Us the People provides humanity with an alternative way of thinking, which is necessary for Us the People to destroy all domination, oppression and exploitation, laying the basis for a new social order. The Founding Manifesto of Us the People launches a critical attack upon prevalent stereotyped ideas about the nature of the modern State, as well as the system of monopoly capitalism. The Manifesto then goes on to present new thought processes and ways of relating which are necessary for emancipation, and presents concrete suggestions for the realization of equal freedom for all. We are the generation of millennials that will stand opposed to 19th and 20th century ideologies, in our quest for equality and socialism. \n</p>\n<br/>\n<p  class=\"animated fadeInUpBig\">\n    In addition to destroying the state and all monopolies, Us the People advocate for a resource-based economy, which uses resources rather than money, and people have access to whatever they need without the use of money, credits, barter, or any other form of debt or servitude. Even if all the money in the world suddenly disappeared, as long as topsoil, factories, and other resources still remained, we could build anything \n    we chose to build and fulfil our material needs. The bottom line is that money is not what people really need; rather, it is access to the necessities of life.\n</p>\n<br/>\n<p  class=\"animated fadeInUpBig\">\n    To Us, the Fourth Industrial Revolution is an opportunity to free humanity, because science and technology create none of our problems, instead our problems arise from human abuse and misuse of other people, the environment, and technology. In a more humane civilization, machines shall be used to shorten the workday, increase the availability of goods and services, and lengthen vacation time. New technology must be used to raise the standard of living for everyone, and in this way, increasing the use of intelligent machine technology serves to benefit all people. \n</p>\n<br/>\n<h4 class=\"well\">US THE PEOPLE LOGO AND COLOURS </h4>\n<img src=\"assets/usThePeople.jpeg\" class=\"img-circle\" style=\"width: 113px;\" >\n<br/>\n<p>\n    The logo of Us the People shall be the global map, representing our Planet Earth, which is under threat from greed. The continents shall be coloured red and black with the land mass surfaced by people across the world, with the red representing the pain of the oppressed and exploited while black represents antiauthoritarianism. The ocean shall be black with green matrix codes and mathematical formulas representing the scientific methods of solving complex problems, unplugging the People from the matrix, as well as our commitment to science and technology as a solution for the future. Above the globe shall be a gold star, representing the Sun that gives energy and light for a bright future. \n</p>";
